import React from "react";

import "../index.css";
import Mapp from './Mapp'
import * as d3 from "d3";
import * as topojson from "topojson-client";
import { ComposableMap, Geographies, Geography } from "react-simple-maps";
import datum from '../daniel.json'


function Map(props) {
  var width = 960,
  height = 1160;
  return (



    <ComposableMap width={width} height={height}  projectionConfig = {{center:[0, 55.4],rotation:[4.4,0,0],parallels:[50,60],scale: 300}}>
    <Geographies geography={datum}>
      {({ geographies }) =>
        geographies.map((geo,index) => {
          console.log(geo)
          if (index !== 5){
            return(
              <Geography stroke='black' fill='none' key={index} geography={geo} />
                )
          }else{
            return(
              <Geography stroke='black' fill='none' key={index} geography={geo} />
                )
          }

      })
      }
    </Geographies>
  </ComposableMap>


  );
}

export default Map;
